import React, { useState, useEffect } from "react";

interface Appointment {
  id: number;
  patientName: string;
  time: string;
  status: string;
}

const ListaPacientes: React.FC = () => {
  const [dailyAppointments, setDailyAppointments] = useState<Appointment[]>([]);

  useEffect(() => {
    // Aqui você fará uma chamada à API para obter os pacientes agendados para o dia atual
    // Por enquanto, usaremos dados de exemplo
    const sampleAppointments: Appointment[] = [
      { id: 1,
        patientName: "Maria Santos",
        time: "09:00",
        status: "Confirmado",
      },
      { id: 2, patientName: "Lucas Nascimento",
      time: "10:00",
      status: "Confirmado" },
      {

      },

    ];
    setDailyAppointments(sampleAppointments);
  }, []);

  return (
    <div>
      <h2>Lista de Pacientes do Dia</h2>
      <table>
        <thead>
          <tr>
            <th>Hora</th>
            <th>Paciente</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {dailyAppointments.map((appointment) => (
            <tr key={appointment.id}>
              <td>{appointment.time}</td>
              <td>{appointment.patientName}</td>
              <td>{appointment.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ListaPacientes;
